(113, 0, 1, 'Cara Kucing Berkomunikasi', '', 'kita sebagai pemilik kucing maupun pecinta kucing pasti sering mempehatikan kucing-kucing bertingkah laku,terus bagaimana ya mereka ngobrol apa hanya bunyi meong saja cara mereka ngobrol atau berkomunikasi. Namun dalam kenyataannya, kucing mampu berkomunikasi dalam beberapa', '', '', '', '', '<p>kita sebagai pemilik kucing maupun pecinta kucing pasti sering mempehatikan kucing-kucing bertingkah laku,terus bagaimana ya mereka ngobrol apa hanya bunyi meong saja cara mereka ngobrol atau berkomunikasi. Namun dalam kenyataannya, kucing mampu berkomunikasi dalam beberapa cara yang berbeda-beda, seperti menimbulkan suara-suara, melalui sikap tubuh, gerakan telinga, mulut dan ekornya, serta binatang ini juga memiliki perbendaharaan kata yang sangat luas dalam usahanya untuk berkomunikasi dengan sesama kucing.</p>\n\n<p>&nbsp;Adapun kemampuan berkomunikasi seperti ini terutama sekali dimiliki oleh para ibu kucing, yaitu bahwa mereka menguasai berbagai macam bunyi-bunyian yang tentu saja sangat membantu mereka dalam berkomunikasi, mengajari ataupun sambil mengoreksi atau memperbaiki kesalahan yang dilakukan oleh anak-anak mereka. Umumnya, bunyi purr atau dengkuran kucing ini menandakan kepuasan atau kegembiraan yang dirasakan kucing tersebut dan volume serta pola nada bunyi dengkuran yang dimiliki oleh setiap kucing akan berbeda satu sama lainnya. Kemudian, perbedaan bunyi dengkuran kucing ini dapat dengan mudah sekali dibedakan dari rendahnya volume keparauan suara yowl atau miaow panjang yang dibuat oleh para penyelundup kucing dan anjing.</p>\n\n<p>&nbsp;Lebih jauh lagi, bunyi miaow atau bunyi meong kucing dapat diperinci lagi menjadi beberapa macam kategori bunyi-bunyian dan hal ini terutama sekali terlihat pada kucing Siam dan kucing Birma yang memiliki lafal bunyi miaow atau meong yang sangat jelas. Namun, pada dasarnya seluruh suara-suara yang ditimbulkan oleh kucing tersebut tidak lain mengekspresikan harapan atau keinginan kucing tersebut atas perhatian dari pemiliknya.</p>\n\n<p>&nbsp;Adapun tingkatan bunyi suara miaow kucing ini bervariasi mulai dari level yang rendah sampai dengan tingkatan bunyi yang tinggi dari seekor kucing yang berjalan mengitari rumah untuk mencari majikannya, dan tingkatan bunyi meong ini akan semakin keras dan berlangsung terus menerus ketika kucing tersebut menginginkan agar majikannya membukakan pintu untuknya ataupun pada saat ia merasa lapar dan ingin segera diberikan makanan oleh majikannya.</p>\n\n<p>&nbsp;Selain itu, peningkatan volume suara meong dari seekor kucing dari pelan menjadi sangat keras dapat pula terjadi apabila kucing tersebut terkurung dalam sebuah keranjang yang berjalan ataupun ketika ada seseorang yang tanpa sengaja menginjak ekornya.</p>\n\n<p>&nbsp;Di samping kucing dapat menimbulkan suara yang keras dan berlangsung terus menerus, terdapat pula bunyi atau suara terputus-putus pada kucing, yang lebih kurang suara itu menyerupai antara bunyi miaow dengan bunyi dengkuran dan seekor kucing akan mengeluarkan suara seperti ini pada saat ia sedang duduk di tepi jendela sambil mengamati burung-burung yang berada di luar.</p>\n', '127.0.0.1', '2013-12-09 12:34:38', 0, '', 0, 0, 1, 23),
(114, 0, 1, 'Di Cina Ditemukan Kucing Bersayap', '', 'Wow… ada kucing bersayap mungkinkah dan ini benar-benar ada. Seekor kucing bewarna putihnamun memiliki sepasang sayap di badannya sebagaimana dilaporkan The Sun, muncul di kota Chongqing.', '', '', '', '', '<p>Wow&hellip; ada kucing bersayap mungkinkah dan ini benar-benar ada. Seekor kucing bewarna putihnamun memiliki sepasang sayap di badannya sebagaimana dilaporkan The Sun, muncul di kota Chongqing.</p>\n\n<p>Menurut pemiliknya, kucing piaraan mereka ini terlahir dengan kondisi normal, namun sejak berusia setahun di badanya mulai tumbuh sepasang sayap.</p>\n\n<p>Sebenarnya, fenomena kucing bersayap ini bukanlah yang pertama kali. Sebelumnya pada 24 Mei 2007 di kota Sichuan, China seorang nenek mempunyai seekor kucing piaraan yang pada kedua sisi tubuh hewan manis itu tumbuh anggota tubuh lainnya yang sepintas diperhatikan mirip berbentuk sayap.</p>\n\n<p>Terdapat sekitar 138 kasus kucing bersayap pernah tercatat dalam sejarah. Sayangnya hanya 28 kasus yang terdokumentasi. Laporan awal mengenai kucing bersayap yang pernah tercatat, terjadi bulan Juni 1842, dilaporkan oleh Henry David Thoreau di daerah pertanian sekitar Lincoln.</p>\n\n<p>Menurut pakar hewan dan cryptozoologi asal Inggris, Dr Karl Shuker yang telah meneliti fenomena pada kucing menjelaskan, ada beberapa penyebab mengapa kucing bisa memiliki bagian tubuh yang mirip sayap secara medis.</p>\n\n<p>Pertama karena bulu rontok yang menggumpal. Pada beberapa laporan menyatakan, saat musim dingin tiba, sayap muncul pada kucing yang berbulu panjang. Kemudian sayap kucing tersebut lepas pada musim semi. Sebagian besar bentuk yang menyerupai sayap tersebut adalah bulu rontok yang menggumpal (gimbal).</p>\n\n<p>Kedua karena cacat lahir yaitu diduga merupakan hasil dari kelahiran cacat kembar siam (conjoined twin) dengan kaki kembaran yang satu lagi muncul di daerah punggung.</p>\n\n<p>Dan ketiga karena penyakit Feline Cutaneous Asthenia (FCA) yaitu suatu penyakit keturunan yang menyebabkan kulit menjadi sangat elastis dan mudah robek/terluka. Elastisitas kulit yang belebihan ini juga dapat terjadi pada anjing dan manusia.</p>\n\n<p>Kucing dengan penyakit FCA mempunyai kulit sensitif yang mudah luka dan robek. Menurut beberapa orang, kemungkinan besar &ldquo;sayap&rdquo; yang muncul di daerah punggung kucing adalah sobekan atau luka di kulit yang masih tertutup bulu.</p>\n', '127.0.0.1', '2013-12-09 12:39:02', 0, '', 0, 0, 1, 24),
(116, 0, 1, 'sdfsdfsdf', '', 'dgfgdf', '', '', '', '', '<p>fgdfgfg</p>\n', '127.0.0.1', '2013-12-09 14:27:20', 0, '', 0, 0, 1, 24),
(117, 0, 1, 'Cara merawat anak kucing dan tipsnya', '', 'Cara merawat anak kucing ,  Setelah lahir anak kucing harus diberi makanan yang alami (susu ibu) dalam waktu 10-20 menit.  Jangan lupa untuk juga memberi makan induk kucing makanan dan air minum saat dia menyusui anak mereka.', '', '', '', '', '<p>Cara merawat anak kucing , &nbsp;Setelah lahir anak kucing harus diberi makanan yang alami (susu ibu) dalam waktu 10-20 menit. &nbsp;Jangan lupa untuk juga memberi makan induk kucing makanan dan air minum saat dia menyusui anak mereka.</p>\n\n<p>Anak kucing dapat memakan makanan padat pada usia dua sampai tiga minggu. Sisihkanlah uang untuk memberi mereka makanan komersial maupun susu komersial khusus anak kucing. Dalam masa pertumbuhann seperti hindari untuk memberi susu sapi atau susu kambing karena masih belum dapat dicerna dengan sempurna karena mengandung laktosa.</p>\n\n<p>Salah satu permasalahan pemilik kucing adalah sifat kucing yang selalu buang kotoran sembarangan. Untuk mengantisipasi hal ini sejak dini maka sediakan dua buah nampan untuk mengganti kotoran dan ganti nampan-nampan tersebut secara teratur pada siang hari. Secara alami anak kucing akan membuang kotoran disanan pada usia tiga sampai empat minggu.</p>\n\n<p>anak-kucing2Untuk induk kucing yang menyusui sebaiknya atau mungkin harus diberi obat cacing setiap bulan. Dan untuk anak kucingnya sendiri harus diberi obat cacing setiap dua minggu. Dimulai pada umur dua minggu sampai berumur tiga bulan.</p>\n\n<p>Anak kucing anda dapat disapih mulai umur delapan minggu. Pada tahap ini induk kucing akan tidak selalu bersama anaknya hingga harus diberi makanan padat.</p>\n\n<p>Supaya nantinya kucing tidak bertindak agresif dengan manusia. Maka anak kucing harus melakukan kontak terhadap manusia pada umur setidaknya dua sampai tujuh minggu.</p>\n\n<p>Supaya kucing tidak menyusahkan anda, Berilah banyak rangsangan baru yang tidak mengancam tentunya. Misalkan saja bunyi-bunyian maupun bertemu dengan binatang lain.</p>\n\n<p>Jangan lupa untuk mengetahui sifat anak kucing, supaya anda dapat menebak suasana hatinya</p>\n\n<p>Jika andak kucing setengah matanya tertutup kemudian memutar sedikit telinganya kesamping itu menandakan anak kucing sedang merasa nyaman<br />\nJika pupil mata membesar itu artinya sedang terkejut<br />\nJika anak kucing mengarahkan telinga dan membuka mata lebar-lebar, itu berarti anak kucing ingin bermain<br />\nJika Mendongak dan menggerakkan kepala ke belakang, itu artinya mungkin seseorang sedang mendekatinya terlalu dekat<br />\nJika sedang mengarahkan telinga, memutarnya ke belakan dan juga mengecilkan pupil mata. WASPADALAH! Anak kucing sedang MARAH.<br />\nSemoga membantu anda dalam merawat anak kucing anda.</p>\n', '127.0.0.1', '2013-12-10 10:18:23', 0, '', 0, 0, 1, 25),
(118, 0, 1, 'Dijual Kucing Persia bluetabby', '', 'Hallo penggemar kucing, kami memberikan penawaran spesial untuk anda…', '', '', '', '', '<p>Hallo penggemar kucing, kami memberikan penawaran spesial untuk anda&hellip;</p>\n\n<p>Dijual kucing persia dengan ciri-ciri sebagai berikut :</p>\n\n<p>Warna blue tabby<br />\nHidung Medium<br />\njenis kelamin jantan<br />\nUmur 6 &nbsp;bulan</p>\n\n<p><br />\nHarga kucing kami patok dengan 1,5 juta rupiah boleh nego lo&hellip;namanya nacha de bianco&hellip;</p>\n\n<p>untuk kucing lainnya bisa dilihat di http://biancocupido.blogspot.com</p>\n\n<p>Berminat hubungi kami di alamat: PINGGIRREJO, Jl. Aru gg 1 Rt 04 Rw 07 Wates Magelang,Jateng</p>\n\n<p>085228774140 / 0813 28098746.</p>\n\n<p>note: Penawaran Iklan Jual Kucing persia ini bisa kami hapus sewaktu-waktu sampai kucing persia ini telah diadopsi oleh pihak lain. Selain itu ada kami juga jual kucing persia warna bluetabby klik disini</p>\n', '127.0.0.1', '2013-12-10 10:19:17', 0, '', 0, 0, 1, 25),
(119, 0, 1, 'Perawatan anak kucing', '', 'Setelah anak kucing melahirkan anda harus tahu cara merawatnya.Dan hal-hal apa yang harus segera dilakukan.', '', '', '', '', '<p>Setelah anak kucing melahirkan anda harus tahu cara merawatnya.Dan hal-hal apa yang harus segera dilakukan. Sebenarnya tidaklah terlalu sulit melakukan perawatan semacam itu. Cukup biarkanlah itu terjadi secara alami.</p>\n\n<p>Namun begitu tidak ada salahnya untuk melakukan sedikit perawatan anak kucing seperti berikut :</p>\n\n<p>Membersikan anak kucing dari kotoran.Terutama pada tali pusar<br />\nSetelah melahirkan pastikan anak kucing mendapatkan kehangatan sesaat. Caranya dengan meletakan mereka di bawah handuk yang diatasnya terdapat botol berisi air hangat. hal ini dilakukankarena kondisi mereka sesaat setelah dilahirkan dalam kondisi basah dan lembab, dan jika tidak dilakukan apa-apa suhu tubuh mereka dapat menurun dengan cepat.<br />\nTiada yang lebih baik mengasuh anak mereka dibanding ibu mereka sendiri. Maka dari itu setelah anda membersihkan kucing segera kembalikan mereka ke induknya.<br />\nUntuk anak kucing yang baru lahir sangat penting untuk mendapatkan susu pertama dari induknya. Jadi anda tidak perlu bingung &ldquo;nih makhluk akan saya beri makan apa&ldquo;. Cukup kembalikan saja ke induknya. Dengan bayi kucing itu mendapatkan susu pertama dari induknya ini akan melindungi si anak kucing dari infeksi.<br />\n2 hal yang perlu anda lakukan setelah kucing melahirkan :</p>\n\n<p>Menentukan jenis kelamin si anak. Untuk mengetahuinya cukup angkat ekor. Lalu akan terlihat dua lubang. Nah! jika ke dua lubang itu berjauhan maka itu pasti jantan. Dan sebaliknya jika keduanya berdekatan maka kucing itu adalah betina.<br />\nHal kedua adalah menimbang berat badan anak kucing yang dilahirkan itu. lakukan itu setiap hari selama 2-2,5 minggu.<br />\nSebenarnya untuk melakukan perawatan pada anak kucing yang baru lahir itu gampang. Biarkan saja dia bersama induknya. Dan jangan ganggu mereka. Tahanlah perasaan gemes dan lucu terhadap si anak kucing setidaknya sampai 2 minggu. &nbsp;Walau begitu jangan dibiarkan begitu saja lihatlah sekali-kali jika ada sesuatu yang tidak beres.</p>\n', '127.0.0.1', '2013-12-10 10:20:11', 0, '', 0, 0, 1, 25),
(120, 0, 1, 'Kucing Patah Hati – Broken Heart', '', 'Aku punya kucing kesayangan, dia sangat aktif dan energik.', '', '', '', '', '<p>Aku punya kucing kesayangan, dia sangat aktif dan energik. Bahkan dia layaknya preman, kalau ada kuncing mendekat di darah kekuasaannya, rambutnya langsung berdiri dan ekornya tegak, garangnya dia dengan suaranya dan juga cakarannya. Kalau aku hitung-hitung sejak dua minggu yang lalu mungkin hampir 21 kali dia cakar mencakar saling baku cakar dengan kucing lawannya. Entah berapa kali aku sering mengobati luka cabikannya. Tapi dasarnya kucing preman dia akhirnya menang dan menang terus meski dengan luka-luka. Bahkan kucing-kucing yang sudah kalah jadi anak buahnya sekarang, kemana-mana ikut dan nga berani lawan.</p>\n\n<p><br />\nNgomong-ngomong nama kucingku itu &ldquo;KUBRANCO&rdquo; (Singkatan Kucing Berandalan Cowok)</p>\n\n<p>Entah kenapa 2 hari terakhir ini dia tidak bergairah, makan tidak banyak, malas berkelahi dan jalannya linglung. Parahnya dia selalu ada termenung di pojokan tembok bahkan di dekat tangga.</p>\n\n<p>&nbsp;</p>\n\n<p>Selidik punya selidik ternyata dia sedang patah hati, wow &hellip; ditolak sama kucing tetangga yang ada di gang Dolly &hellip; yang ternyata lebih memilih kucingnya pejabat yang sering nongkrong di gang Dolly &hellip; psssttttt &hellip; Kasihannya kucingku itu &hellip;</p>\n\n<p>Kasihan sekali &hellip; wake up Bro &hellip; Masih ada kucing yang lain &hellip; yang lebih tulus dan tidak materialisitis &hellip; OK bro &hellip; tunjukkan lagi &hellip; Jiwa Premanmu &hellip; sekian</p>\n\n<p>http://iheboh.blogspot.com/2011/06/kucingku-broken-heart-aka-patah-hati.html#axzz1OVFY6Zfg</p>\n', '127.0.0.1', '2013-12-10 10:21:48', 0, '', 0, 0, 1, 25),
(121, 0, 1, 'Narasi Depan Bahasa Indonesia', '', '', '', '', '', '', '<p><i>PT. Parahita Prima Sentosa (dikenal dengan PARAHITA) berdiri pada tahun 1990 sebagai industri pakaian dengan konsep terpadu, dan berkembang menjadi salah satu perusahaan garment yang bergengsi di Indonesia.<br />\nPARAHITA, berkedudukan di Jln. Danau Jempang BII/14 Pejompongan - Jakarta sebagai kantor pemasaran, dengan fasilitas manufacture tersendiri yang berkedudukan di Kawasan Industri Multi Guna Blok B No. 10A Paku Alam Serpong - Tangerang.</i></p>\n\n<p><i>Sebagai bagian dari strategi bisnis, PARAHITA secara serius berjuang keras untuk membenahi diri secara berkesinambungan agar sesuai atau bahkan dapat melampaui harapan pelanggannya. Tentunya juga berkembang menjadi salah satu perusahaan yang bergengsi dan diperhitungkan dalam menyediakan kebutuhan seragam kerja &amp; promosi.</i></p>\n\n<p><i>untuk menjamin kehandalan produk yang terkirim, kami melengkapi bisnis dengan line-produksi serta mesin-mesin yang dioperasikan oleh para pekerja yang cakap dan kompeten dalam mempersembahkan kebutuhan pelanggan agar mencapai kepuasan tertinggi &amp; terjalinnya kesetiaan.</i></p>\n\n<p><i>Dengan kapasitas produksi melebihi 100.000 pcs perbulan, PARAHITA selalu siap untuk melayani pelanggan dengan memberikan produk &amp; pelayanan berkualitas tinggi dengan harga bersaing. PARAHITA juga secara berkesinambungan membenahi diri untuk dapat menghasilkan produk - produk yang berkualitas tinggi dan inovatif secara berkala dan konsisten agar memenuhi kebutuhan pelanggan menuju hubungan bisnis yang langgeng.</i></p>\n\n<h1>Produk &amp; Layanan</h1>\n\n<p>Sebagai penyedia solusi terpadu untuk kebutuhan seragam koperasi Anda, PARAHITA melayani aneka ragam kebutuhan yang terdiri dari :</p>\n\n<h4>Seragam Kantor;</h4>\n\n<p>- Kemeja, Celana, dan Rok<br />\n- Jas, Blazer, &amp; Jaket formal.</p>\n\n<h4>Seragam Kerja;</h4>\n\n<p>- Kemeja &amp; celana kerja,br&gt; - Coverall &amp; Overall,<br />\n- Pakaian untuk keamanan kerja (Baju &amp; Rompi kerja dengan high visibility &amp; fabric khusus),<br />\n- Rompi Kerja.</p>\n\n<h4>Seragam Promosi;</h4>\n\n<p>- Kemeja,<br />\n- Polo-shirt,<br />\n- T-shirt.</p>\n', '127.0.0.1', '2014-09-16 23:20:12', 0, '', 0, 0, 1, 34),
(122, 0, 1, 'Narasi Depan Bahasa Inggris', '', '', '', '', '', '', '<p>T. Parahita Prima Sentosa (known as Parahita) established in 1990 as the clothing industry with a unified concept, and developed into one of the prestigious garment company in Indonesia.&nbsp;<br />\nParahita, located at Jln. Jempang BII / 14 potty - Jakarta as a marketing agency, with its own manufacturing facilities, located in the Industrial Area Multipurpose Block B # 10A Paku Alam Serpong - Tangerang.&nbsp;</p>\n\n<p>As part of the business strategy, Parahita seriously struggling to transform itself continuously to match or even exceed customer expectations. Surely also developed into one of the prestigious company and calculated in supplying workwear and promotional needs.&nbsp;</p>\n\n<p>to ensure the reliability of the products are sent, we equip businesses with the line-production and machines are operated by skilled workers and competent in delivering these customer needs in order to achieve the highest satisfaction and loyalty intertwining.&nbsp;</p>\n\n<p>With a production capacity of over 100,000 pcs per month, Parahita always ready to serve customers by providing high quality products and services at competitive prices. Parahita also continually transform itself to be able to produce a product - a product of high quality and innovative regularly and consistently to meet customer needs towards a lasting business relationship.</p>\n\n<p>&nbsp;</p>\n\n<p><span style="line-height: 1.6em;">Products &amp; Services&nbsp;</span></p>\n\n<p>As a provider of integrated solutions for the needs of your cooperative uniform, Parahita serve diverse needs consisting of:&nbsp;</p>\n\n<p>Uniform Office;&nbsp;<br />\n- Shirts, Pants, and Skirts&nbsp;<br />\n- Suit, Blazer, and Jacket formal.&nbsp;</p>\n\n<p>Work uniforms;&nbsp;<br />\n- Shirt and work pants, br&gt; - Coverall &amp; Overall,&nbsp;<br />\n- Clothes for job security (Shirt &amp; Vest work with high visibility and a special fabric),&nbsp;<br />\n- Work Vest.&nbsp;</p>\n\n<p>Uniform Promotion;&nbsp;<br />\n- Shirts,&nbsp;<br />\n- Polo-shirt,&nbsp;<br />\n- T-shirt.</p>\n', '127.0.0.1', '2014-09-16 23:32:29', 0, '', 0, 0, 1, 34),
